    cmdsequencestart () {
        CmdSequence = 0;
    }

    cmdexecution () {
        let byteCommands = []; // a compound command

        byteCommands[0] = 0x44;
        byteCommands[1] = 0x52;
        byteCommands[2] = 0x55;
        byteCommands[3] = 0x4E; // var HIGHT = parseFloat(args.HEIGHT);
        // Header (Bytes 0 - 6)

        let command = []; // command[0] = HEAD_CMD.HEAD_SEND_HIGH;

        command[0] = HEAD_CMD.HEAD_MULTIROTOR;
        command[1] = CMD_DIRECTION.SEND; // Calculate command length minus first two header bytes

        command[2] = CMD_Type.CMD_EXECUTION;
        command[3] = 0x46; // 指令序号  (暂时保留)

        command[4] = CmdSequence >> 8 & 0xFF; // 高八位

        command[5] = CmdSequence & 0xFF; // 低八位

        let len = byteCommands.length;
        command[6] = len; // 消息长度，不包括前7字节
        // Bytecodes (Bytes 7 - n)
        // 第8---以后为发送的命令字节

        command = command.concat(byteCommands);
        let tmpsum = 0;

        for (i = 0; i < command.length; i++) {
            tmpsum += command[i];
        }

        command[6 + byteCommands.length + 1] = tmpsum & 0xFF; // 取低八位

        console.log(command);
        this.ws.send(JSON.stringify(command));
    }

