    /**
     * Formats menus into a format suitable for block menus, and loading previously
     * saved projects:
     * [
     *   {
     *    text: label,
     *    value: index
     *   },
     *   {
     *    text: label,
     *    value: index
     *   },
     *   etc...
     * ]
     *
     * @param {array} menu - a menu to format.
     * @return {object} - a formatted menu as an object.
     * @private
     */
    _formatMenu (menu) {
        const m = [];
        for (let i = 0; i < menu.length; i++) {
            const obj = {};
            obj.text = menu[i];
            obj.value = i.toString();
            m.push(obj);
        }
        return m;
    }

    /**
     *
     * @param {*} head
     * @param {*} directionlow
     * @param {*} type
     * @param {*} methods
     * @param {array} byteCommands
     */
    generateCommand (head, directionlow, type, methods, byteCommands) {
        // Header (Bytes 0 - 6)
        let command = []; // command[0] = HEAD_CMD.HEAD_SEND_HIGH;

        command[0] = head;
        command[1] = directionlow; // Calculate command length minus first two header bytes

        command[2] = type;
        command[3] = methods; // 指令序号  (暂时保留)

        command[4] = CmdSequence >> 8 & 0xFF; // 高八位
        command[5] = CmdSequence & 0xFF; // 低八位

        CmdSequence++; // 如果指令超限,将指令序号归零

        if (CmdSequence > 65535) {
            CmdSequence = 0;
        }

        let len = byteCommands.length;
        command[6] = len; // 消息长度，不包括前7字节
        // Bytecodes (Bytes 7 - n)
        // 第8---以后为发送的命令字节

        command = command.concat(byteCommands);
        let tmpsum = 0;

        for (i = 0; i < command.length; i++) {
            tmpsum += command[i];
        }

        command[6 + byteCommands.length + 1] = tmpsum & 0xFF; // 取低八位

        return command;
    }


